import 'package:json_annotation/json_annotation.dart';part 'character.g.dart';@JsonSerializable()class CharacterResponse {  CharacterResponse({    this.info,    this.results,  });  Info? info;  List<Character>? results;  factory CharacterResponse.fromJson(Map<String, dynamic> json) => _$CharacterResponseFromJson(json);  Map<String, dynamic> toJson() => _$CharacterResponseToJson(this);}@JsonSerializable()class Character {  Character({    this.id,    this.name,    this.status,    this.species,    this.type,    this.gender,    this.image,    this.episode,    this.url,    this.created,  });  int? id;  String? name;  String? status;  String? species;  String? type;  String? gender;  String? image;  List<String>? episode;  String? url;  DateTime? created;  factory Character.fromJson(Map<String, dynamic> json) => _$CharacterFromJson(json);  Map<String, dynamic> toJson() => _$CharacterToJson(this);}@JsonSerializable()class Info {  Info({    this.count,    this.pages,    this.next,    this.prev,  });  int? count;  int? pages;  String? next;  dynamic prev;  factory Info.fromJson(Map<String, dynamic> json) => _$InfoFromJson(json);  Map<String, dynamic> toJson() => _$InfoToJson(this);}